import react from 'react';

const currencies = ['USD','EUR','RUB']

const Select = () => {
    return (
        <div class="currency-fields__select">
            <select name="" id="">{
                currencies.map(currency => <option value={ currency }>{ currency }</option>)
            }</select>
            <div>
                <svg>
                    <use xlinkHref="#arrow-down"></use>
                </svg>
            </div>
        </div>
    )
}

export default Select;
